import React, {useEffect} from 'react'
import './App.css';
import 'materialize-css/dist/css/materialize.min.css';
import M from 'materialize-css/dist/js/materialize.min.js';



const  App = () => {

  useEffect(() => {
      //Init Materialize javascript
      M.AutoInit();
  }
  )


  return (
    <div className="App">             
        <p>
          Event Finder Application
        </p>      
    </div>
  );
}

export default App;
